import React from "react";
import { Box } from '@material-ui/core';

function SortByWeek() {
    return (
        <Box
            sx={{
            backgroundColor: '#ffffff',
            color: '#929292',
            textAlign: 'start',
            border: '1px solid #ead9da',
            borderRadius: '15px',
            padding: '5px 10px'
        }}
        >
            <p></p>
        </Box>
    )
}

export default SortByWeek;
